// frontend/src/components/Footer.js
import React from 'react';
// import './Footer.css'; // Footer 전용 CSS가 있다면

function Footer() {
  return (
    <footer className="footer">
      <p>&copy; 2025 고래봉은 존재한다.</p>
    </footer>
  );
}

export default Footer;
